import React, { useState } from "react";

const Training = ({ mapContainerStyle, setMapContainerStyle }) => {
  const toggleDisplayStyle = () => {
    setMapContainerStyle((prevStyle) => ({
      ...prevStyle,
      display: prevStyle.display === "block" ? "flex" : "block",
    }));
  };

  return (
    <div>
      <h1>Training</h1>
      <button onClick={toggleDisplayStyle}>
        Toggle Map Display Style
      </button>
      {/* Placez ici votre contenu spécifique à l'onglet "Training" */}
    </div>
  );
};

export default Training;
